import React from 'react';
import { AppBar , Toolbar, Grid } from "@material-ui/core";

const useStyles = makeStyles({
    pokedexContainer: {
        paddingTop: '20px',
        paddingLeft: '50px',
        paddingRight: '50px'
    }
})

const Pokedex = () => {
    constclasses = useStyles();
    return (
        <>
            <AppBar position = "static">
                <Toolbar />
            </AppBar>
            <Grid container spacing = {2} className = {classes.pokedexContainer}>
                <Grid item xs = {2}>
                    this is item 1
                </Grid>
                <Grid item xs = {2}>
                    this is item 2
                </Grid>
                <Grid item xs = {2}>
                    this is item 3
                </Grid>
                <Grid item xs = {2}>
                    this is item 4
                </Grid>
            </Grid>
        </>
    )
}

export default Pokedex;
